import React, { Component } from "react";
import AppNavBar from "../Components/AppNavbar.js"


class History extends Component {
    render () {
        return (
           <div>
               <AppNavBar />
                <h4>Welcome to History</h4>
           </div>
        )
    }
};

export default History;
